    `},{title:"Organik Tarm Pazar 2024'te %40 Byd",summary:"Tketici artk ne yediini bilmek istiyor. Pestisitsiz, sertifikal rnlere talep patlamas yaanyor.",date:"02 Mays 2024",category:"Trend",image:"https://images.unsplash.com/photo-1615485290382-441e4d049cb5?q=80&w=800&auto=format&fit=crop",content:`
