    `},{title:"Gda Enflasyonu ile Mcadelenin Anahtar: Kooperatifler",summary:"Birlikten kuvvet doar. Kk reticilerin dev pazarda ayakta kalmasnn tek yolu rgtlenmek.",date:"28 Nisan 2024",category:"Strateji",image:"https://images.unsplash.com/photo-1560493676-04071c5f467b?q=80&w=800&auto=format&fit=crop",content:`
