    `},{title:"Lojistikte Souk Zincir: Gdann mrn Uzatan Teknoloji",summary:"Tarladan kan rnn %25'i yolda ryor. Souk zincir lojistii neden hayati nem tayor?",date:"25 Nisan 2024",category:"Lojistik",image:"https://images.unsplash.com/photo-1586528116311-ad8dd3c8310d?q=80&w=800&auto=format&fit=crop",content:`
