    `},{title:"Devlet Destekleri Rehberi 2024: Hangi rne Ne Kadar Hibe?",summary:"Mazot, gbre ve sertifikal tohum desteinde son durum. iftinin cebine ne girecek?",date:"22 Nisan 2024",category:"Mevzuat",image:"https://images.unsplash.com/photo-1500382017468-9049fed747ef?q=80&w=800&auto=format&fit=crop",content:`
