    `},{title:"Ata Tohumu Projesi: Gemiin Miras Gelecein Teminat",summary:"Hibrit tohumlara kar yerel tohumlarn direnii. Lezzet ve besin deeri analizi.",date:"20 Nisan 2024",category:"Kltr",image:"https://images.unsplash.com/photo-1492496913980-501348b61469?q=80&w=800&auto=format&fit=crop",content:`
